import React from "react";
import { FaLocationArrow } from "react-icons/fa";
import { Link } from "react-router-dom";
import "./App.css";

function Nav() {
  return (
    <nav>
      <ul>
        <Link>
          <li className="home">Home</li>
        </Link>
        <button>
          <FaLocationArrow className="location-btn" />
        </button>
        <li>Login</li>
      </ul>
    </nav>
  );
}

export default Nav;
